import styled from 'styled-components'

const BackGroundContent = styled.div`
  position: absolute;
  width: calc(100% - 300px);
  height: 100%;
  left: 300px;
  top: 0;
  z-index: 100;
  display: none;
  background-color: white;
`
export default BackGroundContent
